import React, { useState } from 'react';

const TechniqueTable = ({ techniques, positions, updateTechnique, deleteTechnique }) => {
    const [isEditing, setIsEditing] = useState(null);
    const [editedTechnique, setEditedTechnique] = useState(null);

    const getPositionName = (positionId) => {
        if (!positions || positions.length === 0) return 'Sin posición';  // Manejo de error
        const position = positions.find((pos) => pos._id === positionId);
        return position ? position.name : 'Sin posición';
    };

    const handleEdit = (technique) => {
        setIsEditing(technique._id);
        setEditedTechnique({ ...technique });
    };

    const handleCancel = () => {
        setIsEditing(null);
        setEditedTechnique(null);
    };

    const handleSave = () => {
        updateTechnique(editedTechnique);
        setIsEditing(null);
    };

    return (
        <table style={styles.table}>
            <thead>
                <tr>
                    <th>Nombre</th>
                    <th>Tipo</th>
                    <th>Posición Inicial</th>
                    <th>Posición Final</th>
                    <th>Proficiency Level</th>
                    <th>Gi/No Gi</th>
                    <th>Acciones</th>
                </tr>
            </thead>
            <tbody>
                {techniques.map((technique) => (
                    <tr key={technique._id}>
                        {isEditing === technique._id ? (
                            <>
                                <td>
                                    <input
                                        type="text"
                                        value={editedTechnique.name}
                                        onChange={(e) =>
                                            setEditedTechnique({
                                                ...editedTechnique,
                                                name: e.target.value,
                                            })
                                        }
                                    />
                                </td>
                                <td>
                                    <input
                                        type="text"
                                        value={editedTechnique.techniqueType.join(', ')}
                                        onChange={(e) =>
                                            setEditedTechnique({
                                                ...editedTechnique,
                                                techniqueType: e.target.value.split(',').map(t => t.trim()),
                                            })
                                        }
                                    />
                                </td>
                                <td>{getPositionName(technique.positionStart)}</td>
                                <td>{getPositionName(technique.endPosition)}</td>
                                <td>
                                    <input
                                        type="number"
                                        min="1"
                                        max="10"
                                        value={editedTechnique.proficiencyLevel}
                                        onChange={(e) =>
                                            setEditedTechnique({
                                                ...editedTechnique,
                                                proficiencyLevel: Number(e.target.value),
                                            })
                                        }
                                    />
                                </td>
                                <td>
                                    <select
                                        value={editedTechnique.giNoGi}
                                        onChange={(e) =>
                                            setEditedTechnique({
                                                ...editedTechnique,
                                                giNoGi: e.target.value,
                                            })
                                        }
                                    >
                                        <option value="gi">Gi</option>
                                        <option value="nogi">No Gi</option>
                                        <option value="both">Ambos</option>
                                    </select>
                                </td>
                                <td>
                                    <button onClick={handleSave}>Guardar</button>
                                    <button onClick={handleCancel}>Cancelar</button>
                                </td>
                            </>
                        ) : (
                            <>
                                <td>{technique.name}</td>
                                <td>{technique.techniqueType.join(', ')}</td>
                                <td>{getPositionName(technique.positionStart)}</td>
                                <td>{getPositionName(technique.endPosition)}</td>
                                <td>{technique.proficiencyLevel}</td>
                                <td>{technique.giNoGi}</td>
                                <td>
                                    <button onClick={() => handleEdit(technique)}>Editar</button>
                                    <button
                                        onClick={() => deleteTechnique(technique._id)}
                                        style={styles.deleteButton}
                                    >
                                        Eliminar
                                    </button>
                                </td>
                            </>
                        )}
                    </tr>
                ))}
            </tbody>
        </table>
    );
};

const styles = {
    table: {
        width: '100%',
        borderCollapse: 'collapse',
    },
    deleteButton: {
        color: 'red',
    },
};

export default TechniqueTable;
